import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import Menu from './Menu.js';
import logo from './IMG/logo.png'; // Importa la imagen

function App() {
  return (
    <div className="App">
      <header className="App-header text-center">
        <img
          src={logo} // Usa la imagen importada
          className="App-logo img-fluid"
          alt="Logo de SUNSUCA, con elementos de tecnología y naturaleza"
        />
        <h1 className="App-title mt-4 mb-3">Bienvenido a SUNSUCA</h1>
      </header>

      {/* Menú de navegación */}
      <nav className="navbar navbar-expand-lg navbar-light bg-light">
        <Menu />
      </nav>

      {/* Sección principal de contenido */}
      <main className="container mt-5">
        <section>
          <h2 className="text-center">¿Quiénes somos?</h2>
          <p>
            En SUNSUCA nos dedicamos a la innovación y el desarrollo de soluciones tecnológicas
            sostenibles para el sector agropecuario. Nuestra misión es crear un futuro más verde y eficiente.
          </p>
        </section>
        {/* Puedes agregar más secciones de contenido aquí */}
      </main>

      {/* Pie de página */}
      <footer className="App-footer text-center mt-5 p-4 bg-dark text-white">
        <p>&copy; 2024 SUNSUCA - Todos los derechos reservados</p>
      </footer>
    </div>
  );
}

export default App;
